        setListOfFlights(result.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div>
      <div className="Login">
        <h1>Login</h1>
      </div>
      <div className="App">
        <div className="LoginInputs">
          <input
            type="text"
            placeholder="Email..."
